import React from 'react';
import { TextField, FormControl, Input, Box } from '@mui/material';
import styled from 'styled-components';

const StyledTextField = styled(TextField)`
  color: white;
`;
const Contact = () => {
  return (
    <div className=" content bg-color " id="contact">
      <h1>Contact</h1>
      <div className="form">
        <form noValidate autoComplete="off">
          <StyledTextField
            id="standard-full-width"
            placeholder="Name"
            fullWidth
            variant="filled"
            focused
          />
        </form>
      </div>
    </div>
  );
};

export default Contact;
